"use strict";(self.webpackChunkweslley_io=self.webpackChunkweslley_io||[]).push([[5486],{795:function(e){e.exports=JSON.parse('{"title":"Semana de Sistemas de Informa\xe7\xe3o (EACH-USP)","slug":"semana-de-sistemas-de-informacao-each-usp","date":"2025-08-21","authors":["Weslley Ara\xfajo"],"tags":["Brazil","SP","S\xe3o Paulo"],"content":"\\n\ud83c\udf99\ufe0f **Keynote:** GitHub Beyond Code: overcoming in the job market through open source\\n\\n:::note\\nSpeaking at a university ([**USP**](https://www5.each.usp.br/)) is special in itself, but closing the day\'s event made it even more special \u2728\\n\\nThe [**SSI**](https://www.semanadesi.com/) is an event organized by the university students themselves, and I had the pleasure of being invited to teach through open source, using **GitHub** as a learning tool.\\n:::\\n\\n{/* truncate */}\\n\\n<hr />\\n\\nFocusing on how to stand out in an increasingly competitive market, I show how open source can accelerate your technical growth, enabling you to achieve unimaginable milestones that directly impact your professional career.\\n\\nIn a market that is more competitive every day, open source is not just about code \u2014 it\'s a direct bridge to technical growth, global visibility, and real career opportunities.\\n\\nWith visual, human, and real examples, I want to inspire you and bring an optimistic perspective of yourself in an increasingly intimidating world, especially with the rise of artificial intelligence, using open source strategically to build credibility and trust in the market.\\n","filePath":"each-usp.mdx","mdxPath":"/home/runner/work/weslley.io/weslley.io/i18n/en/talks/2025/08/21/each-usp.mdx","summary":[],"description":"\ud83c\udf99\ufe0f **Keynote:** GitHub Beyond Code: overcoming in the job market through open source\\n\\n:::note\\nSpeaking at a university ([**USP**](https://www5.each.usp.br/)) is special in itself, but closing the day\'s event made it even more special \u2728\\n\\nThe [**SSI**](https://www.semanadesi.com/) is an event organized by the university students themselves, and I had the pleasure of being invited to teach through open source, using **GitHub** as a learning tool.\\n:::","social":"./banner.jpeg","socialPath":"/home/runner/work/weslley.io/weslley.io/i18n/en/talks/2025/08/21/banner.jpeg","readingTime":1,"lastModified":"2026-01-22T05:46:00.000Z","authorsData":[{"name":"Weslley Ara\xfajo","title":"Active open-source contributor, Microsoft MVP, MySQL2\'s maintainer and Poku\'s creator \u2728","url":"https://weslley.io/en/","image_url":"/img/avatar.png","socials":{"linkedin":"wellwelwel","github":"wellwelwel","instagram":"wellwelwel","youtube":"weslleyio"}}],"previousArticle":{"title":"MVP Conf: Tech Talk","slug":"mvp-conf3A-tech-talk","description":"\ud83d\udcf9 **Palestra (Live):** GitHub Beyond Code: overcoming in the job market through open source\\n\\n:::note Summary\\nAimed at new developers, I spoke about the impact that open source and **GitHub** can have on our careers, on the **TechTalk** program from the [**MVP Conf**](https://www.youtube.com/@mvpconf) channel, hosted by [**Vanessa Valle**](https://www.linkedin.com/in/vanessabrava/) and [**Renata Correa**](https://www.linkedin.com/in/correa-renata-ti/).\\n:::","social":"/home/runner/work/weslley.io/weslley.io/i18n/en/talks/2025/08/27/banner.png"},"nextArticle":{"title":"DevConverge LATAM & Oracle \u2014 SPRINT SP","slug":"devconverge-latam-26-oracle-sprint-sp","description":"\ud83c\udf99\ufe0f **Talk:** Inventing the New: The Meeting Point Between Human Creativity and AI-Assisted Generation\\n\\n:::note Summary\\nImproving performance in a legacy system is part of the routine. Inventing algorithms and a brand-new architecture is something completely different.\\n:::","social":"/home/runner/work/weslley.io/weslley.io/i18n/en/talks/2025/08/09/banner.jpeg"},"route":"talks"}')}}]);